import "./FooterStyles.css";

import React from 'react';
import { FaFacebook, FaHome, FaLinkedin, FaMailBulk, FaPhone, FaTwitter } from "react-icons/fa";

const Footer = () => {
  return (
    <div className="footer">
        <div className="footer-container">


            <div className="left">
                <div className="location">
                    <FaHome size={20} style={{
                    color:"#fff", margin:"2rem"}} />
                    <div>
                    <p>Kozhikode, Kerala</p>
                    <p> 673631</p></div>
                </div>

                <div className="phone">
                    <FaPhone size={20} style={{
                        color:"#fff", margin:"2rem"}} />
                    <div><h4> (+91)-9544347709</h4></div>
                </div>

                <div className="email">
                    <h4><FaMailBulk size={20} style={{
                        color:"#fff", margin:"2rem"}} />
                     thouzy77@gmail.com</h4>
                </div>
            </div>


            <div className="right">
                <h4>About Me</h4>
                <p>This is me Thousif Thaj, I'm a React Front-End Developer
                    and this is my portfolio website. </p>
            </div>
            <div className="social">
            <FaFacebook size={20} style={{
            color:"#fff", margin:"2rem"}} />
            <FaTwitter size={20} style={{
            color:"#fff", margin:"2rem"}} />
            <FaLinkedin size={20} style={{
            color:"#fff", margin:"2rem"}} />
            
            </div>
        </div>
    </div>
  )
}

export default Footer;
